This PR brings the following changes:
- Fixes TensorRT behaviour when using dynamic shape. TensorRT requires to set a max, min and optimal value for each dynamic axis of the network inputs, so the dynamic_info structure has been changed in the following way:

**old_way**:

``` python
# Set dynamic info
dynamic_info = {
    "inputs": [
        {0: "batch", 2: "dim_image", 3: "dim_image"}
    ],
    "outputs": [
        {0: "batch", 1: "out_dim"}
    ]
}
```
**new_way**:

``` python
# Set dynamic info
dynamic_info = {
    "inputs": [
        {
            0: {"name": "batch", "min_val": 1, "opt_val": 1, "max_val": 4}, 
            2: {"name": "dim_image", "min_val": 224, "opt_val": 256, "max_val": 320},  
            3: {"name": "dim_image", "min_val": 224, "opt_val": 256, "max_val": 320},
        } 
    ],
    "outputs": [
        {0: "batch", 1: "out_dim"}
    ]
}
```
The old format is still supported, but does not work with TensorRT.

- Fixes some issues with unit tests, and adds additional controls to ensure that an optimized model with dynamic shape works properly.
- Improves significantly the performance of TensorRT with ONNX interface
- Removes all custom code for yolov5, because now can be optimized directly without wrappers, and updates the notebook
- Limits the gpu memory used by tensorflow, to avoid memory issues during tensorflow models optimization
